      | 363357 -> { ItemTypeData.id= 363357; name= "'Charstone' Plasma Cannon"; published= false; description= "The plasma cannon is a single-shot, direct-fire weapon developed by Allotek Industries primarily for use in urban operations and confined space combat. The dense plasma discharge it generates is highly unstable, decaying rapidly and venting sufficient heat and energy to severely damage targets caught within its critical emission radius.    During the short pre-fire charge, ultracold plasma is prepared and then heated inside a magneto-core trap. Just prior to discharge, a small precursor projectile is fired that produces (and is ultimately consumed by) a short-lived trail that helps guide and contain the volatile discharge as it travels towards its target."; marketGroupId= None; groupId= 350858; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 363551 -> { ItemTypeData.id= 363551; name= "Magsec SMG"; published= false; description= "The magsec is a semi-automatic firearm capable of sustained, accurate fire at ranges beyond what conventional sidearms can offer. A high-speed slider feeds current to a magazine of hyper velocity projectiles that are discharged with minimal separation, maximizing energy efficiency and reducing flux shear to produce a weapon with lethal kinetic potential.     Having overcome early reliability issues, manufacturers  have since taken advantage of the weapon’s modular design; the magsec has been made available in multiple combat configurations – including optical sights and silenced operation – and is in widespread service throughout the cluster."; marketGroupId= None; groupId= 350858; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
