      | 365200 -> { ItemTypeData.id= 365200; name= "HEP Metabolic Enhancer"; published= false; description= "Initially developed during the Human Endurance Program, Inherent Implants have improved and adapted their  formula to suit the new generation of cloned soldiers.    Building on the initial success of a targeted intravenous infusion of nanite laced adrenaline into the bloodstream, this package contains two doses of stimulant that are pushed directly to the muscles and respiratory system for optimal uptake. The two compounds, consisting of DA-640 Synthetic Adrenaline and GF-07 Filtered Testosterone, are intravenously administered through the user’s dropsuit support systems. The result of using such highly intelligent nanite based compounds is an immediate boost in respiratory and muscle function, allowing the user to sprint faster and inflict greater melee damage."; marketGroupId= None; groupId= 351121; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.010000; packagedVolume= 0.000000; portionSize= 1; radius= 1.000000; volume= 0.000000 } |> Some
      | 365297 -> { ItemTypeData.id= 365297; name= "'Neo' Commando A-I"; published= false; description= "The Commando dropsuit is a variable combat unit capable of reacting to battlefield threats as they emerge. Built using a repurposed heavy frame, the suit is designed for maximum offensive flexibility. The streamlined frame does away with extraneous armor layers, using the augmented power of the exoskeleton to instead shoulder the weight and bulk of two light-class weapons.    Interlaced with subframe wiring, the Amarr variant utilizes asymmetric power distribution to intelligently reroute power to the suit’s various subsystems as needed. This improved throughput allows light-class laser weaponry to draw from the suit’s power reserves to enhance the damage dealt.    The Commando is the ultimate suppression fighter. What the suit sacrifices in tactical versatility, it more than makes up for with flexible weapon loadouts that can counter any of the myriad threats an ever-evolving battlefield may present."; marketGroupId= None; groupId= 351064; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 365685 -> { ItemTypeData.id= 365685; name= "'Pyrus' Flaylock Pistol"; published= false; description= "Utilizing sub-licensed technology sourced from all across the cluster, Allotek Industries’ Pyrus product line offers a wide range of dropsuit and weapon variants developed and manufactured in accordance with the corporation’s stringent guidelines to ensure that all products are worthy of carrying the Allotek quality guarantee."; marketGroupId= None; groupId= 350858; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 365879 -> { ItemTypeData.id= 365879; name= "Small Turret Operation"; published= false; description= "Basic understanding of small turret operation.    Unlocks the ability to use small blaster, railgun and missile launcher turrets. 2% reduction to PG/CPU usage of small turrets per level."; marketGroupId= None; groupId= 351648; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 365976 -> { ItemTypeData.id= 365976; name= "'Neo' Scout ck.0"; published= false; description= "The Scout dropsuit is a lightweight suit optimized for enhanced mobility, multi-spectrum stealth, and heightened awareness. Augmented joint servo motors give every movement extra speed and flexibility, while integrated friction and impact dampening materials reduce the overall sound signature.     Developed to support counterinsurgency operations, this Caldari suit is highly effective at asymmetric combat. An enhanced sensor package allows it to seek out and destroy dampened targets wherever they might be on the battlefield.    When missions call for speed and stealth, situations in which heavily armored suits would be more of a burden than an advantage, a scout dropsuit is the best option. The enhanced mobility it provides makes up for its relatively low protection, and when combined with stealth technology modules, the scout suit is the obvious choice for infiltration, counter-espionage, and assassination."; marketGroupId= None; groupId= 351064; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 366364 -> { ItemTypeData.id= 366364; name= "Federation Assault G/1-Series"; published= false; description= "The Assault dropsuit is a versatile frontline combat suit that combines excellent protection, good mobility, and sufficient hard points for mission-specific customizations.    Gallente forces have access to some of the most advanced armor systems in the cluster. An ablative-variant solution is used to dissipate energy across available surface area with only minimal degradation of the material at the impact point resulting in armor that is efficient and durable enough to maintain operational integrity for multiple short-term engagements. Augmented ferro-fibre musculature enhances the soldier’s strength, balance, and reaction time, while quad-opsis sensors allow wide arc identification and prioritization of battlefield targets.    Assault dropsuits are intended for standard combat operations or those in which the objectives are likely to change at a moment’s notice. Its ability to carry anything from small arms and explosives to anti-vehicle munitions and deployable support gear makes it the most adaptable direct combat suit on the battlefield."; marketGroupId= None; groupId= 351064; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 366461 -> { ItemTypeData.id= 366461; name= "Republic Mass Driver"; published= false; description= "The Mass Driver is a semi-automatic, multi-shot grenade launcher useful as both a breaching tool and area denial weapon. Firing smart HIND explosive rounds, the weapon is highly effective against all forms of dropsuit and light vehicle, while its lightweight frame and compact design make it easy to wield in both urban and open terrain engagements."; marketGroupId= None; groupId= 350858; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
