      | 367625 -> { ItemTypeData.id= 367625; name= "Militia Plasma Cannon Blueprint"; published= false; description= "The plasma cannon is a single-shot, direct-fire weapon developed by Allotek Industries primarily for use in urban operations and confined space combat. The dense plasma discharge it generates is highly unstable, decaying rapidly and venting sufficient heat and energy to severely damage targets caught within its critical emission radius.    During the short pre-fire charge, ultracold plasma is prepared and then heated inside a magneto-core trap. Just prior to discharge, a small precursor projectile is fired that produces (and is ultimately consumed by) a short-lived trail that helps guide and contain the volatile discharge as it travels towards its target."; marketGroupId= None; groupId= 350858; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 3681 -> { ItemTypeData.id= 3681; name= "Caldari Osprey Cruiser"; published= false; description= "In YC114 each major empire faction, having been embroiled in a harrowing, extensive, long-term war, recognized the growing need for support and logistics functionality in their vessels during the kind of protracted interstellar warfare that might otherwise prove exhausting for its participants. Both Frigate and Cruiser-class ships were put under the microscope, and in the Caldari State the outcome of the re-evaluation process led, among other developments, to a redesign and redeployment of the Osprey. The Osprey originally offered excellent versatility and power for what was considered a comparably low price. After its redesign, its inbuilt mining technology - now a little creaky and long in the tooth - was gutted from the Osprey and replaced in its entirety with tech of a different type, capable of high energy and shield transfers."; marketGroupId= None; groupId= 226; dogmaAttributes= [| { DogmaAttributeValueData.attributeId = 9; value= 100000000.000000 }; { DogmaAttributeValueData.attributeId = 162; value= 174.000000 }; { DogmaAttributeValueData.attributeId = 4; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 38; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 161; value= 0.000000 } |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= Some(41); mass= 0.000000; packagedVolume= 0.000000; portionSize= 1; radius= 174.000000; volume= 0.000000 } |> Some
