      | 47816 -> { ItemTypeData.id= 47816; name= "Decayed Large Armor Plate Mutaplasmid"; published= true; description= "This bioadaptive mutaplasmid tool is designed to interface with and alter supplemental armor layering systems. As such this mutaplasmid could be used to mutate the performance characteristics of most armor plates in the correct size class.    Triglavian bioadaptive technology makes extensive use of engineered colonies of extremophilic bacteria, that are used to grow, harvest and adapt various resources found in Abyssal Deadspace. Artificial colonizing plasmids integrated into specialist tools used for direct adaptation of technology can be found in Triglavian caches in various stages of development. These mutaplasmids can be used to alter the characteristics of a wide variety of equipment types, depending on the strain and the bioadaptive tool with which they are integrated.    The mutaplasmid colony integrated into this bioadaptive tool has begun to decay and mutation effects will be less pronounced as a result. While possible mutational benefits are low, the risks of using this mutaplasmid are also reduced."; marketGroupId= Some(2445); groupId= 1964; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 1.000000; packagedVolume= 1.000000; portionSize= 1; radius= 1.000000; volume= 1.000000 } |> Some
      | 47913 -> { ItemTypeData.id= 47913; name= "Light Scoped Entropic Disintegrator"; published= true; description= "This small Entropic Disintegrator is typically seen in use on Triglavian frigates and destroyers, which are able to handle the relatively minimal radiation and gravitational tidal forces the weapon generates as a side-effect of its operation.    Entropic Disintegrators draw on the tremendous power of the Triglavian singularity-based energy systems to convert exotic matter into a particle stream directed with locally generated entropic force. While powerful, the range of the weapon is limited by the attenuation of entropic forces, which dissipate critically beyond the optimal range. As a result this weapon has no falloff range.    The particle stream generates thermal and explosive reactions on impact, and the entropic forces resolve into a localized gravitational conduit that steadily increases the acceleration on the exotic particles. In effect, the weapon's damage potential increases to a maximum level as long as the particle stream is kept on the same target.    Requires exotic plasma charge ammo types: Baryon, Meson, and Tetryon."; marketGroupId= Some(2433); groupId= 1986; dogmaAttributes= [| { DogmaAttributeValueData.attributeId = 128; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 1795; value= 0.010000 }; { DogmaAttributeValueData.attributeId = 4; value= 500.000000 }; { DogmaAttributeValueData.attributeId = 1302; value= 47269.000000 }; { DogmaAttributeValueData.attributeId = 6; value= 5.200000 }; { DogmaAttributeValueData.attributeId = 9; value= 40.000000 }; { DogmaAttributeValueData.attributeId = 1944; value= 52254.000000 }; { DogmaAttributeValueData.attributeId = 277; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 278; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 1303; value= 48636.000000 }; { DogmaAttributeValueData.attributeId = 1304; value= 49710.000000 }; { DogmaAttributeValueData.attributeId = 1305;